import React from "react";
import { Document, Page, View, Text, StyleSheet } from '@react-pdf/renderer';

const styles = StyleSheet.create({
    page: {
        fontFamily: 'Roboto, sans-serif',
        backgroundColor: '#FFFFFF',
        margin: 10,
        padding: 10,
    },
    section: {

    },
    heading: {
        fontSize: '16px',
        fontWeight: 'bold'
    }
});
export const IsbarDoc = (props) => {

    return (
        <Document>
            <Page size="A4" style={styles.page}>
                <View style={styles.section}>
                    <Text style={styles.heading}>I: Introduction</Text>
                    <Text>{props.content.item[0].answer[0].valueString}</Text>
                </View>
                <View style={styles.section}>
                    <Text style={styles.heading}>S: Situation</Text>
                    <Text>{props.content.item[1].answer[0].valueString}</Text>
                </View>
                <View style={styles.section}>
                    <Text style={styles.heading}>B: Background</Text>
                    <Text>{props.content.item[3].answer[0].valueString}</Text>
                </View>
                <View style={styles.section}>
                    <Text style={styles.heading}>A: Assessment</Text>
                    <Text>{props.content.item[4].answer[0].valueString}</Text>
                </View>
                <View style={styles.section}>
                    <Text style={styles.heading}>R: Recommendation</Text>
                    <Text>{props.content.item[5].answer[0].valueString}</Text>
                </View>
            </Page>
        </Document>
    )
}
export const IsobarDoc = (props) => {

}
